import React from 'react'
import {RightSide} from '../MyComponets/RightSide';
import {LeftSide} from '../MyComponets/LeftSide';

export const Content = () => {
    return (
        <div>
            <div className="container">
            <div className="row">
            <div className="col-md-8">
            <LeftSide/>
            </div>
            <div className="col-md-4">
            <RightSide/>
            </div>
            </div>
            </div>
        </div>
    )
}
